import './App.css';
import NavBar from './components/navbar';
import React, {useEffect} from 'react';
import { useDispatch } from 'react-redux';
import { getProducts } from './actions/products';
import { useSelector } from 'react-redux';
import ProdcutTable from './components/producttable';
import ProModalNew from './components/newproductmodal';

const App = () => {
  const products = useSelector((state) => state.products);

  let editModals = products.map((pro) => {
    return(
      <React.Fragment>
        <ProModalNew
          key={pro._id}
          productId={pro._id}
          name={pro.name}
          manufacturer={pro.manufacturer}
          style={pro.style}
          purchasePrice={pro.purchasePrice}
          salePrice={pro.salePrice}
          quantity={pro.quantity}
          commisionPercentage={pro.commisionPercent} 
          />
      </React.Fragment>
    )
  })

  return (
    <div className='bg-stone-900 min-h-screen'>
      <div>
        <NavBar />
      </div>
      <div className='place-items-center grid grid-cols-2 gap-4 text-white'>{editModals}
        <div className='py-10'><ProdcutTable /></div>
        <div>02</div>
        <div>03</div>
        <div>04</div>
      </div>

      <ProModalNew/>
    </div>
  )
}

export default App;
